import logo from './logo.svg';
import './App.css';
import Data from './data.json';
import Card from "react-bootstrap/Card";


function App() {
  return (
    <div className="App">
      <div className="mail">
        { Data.map(mail => {
          return(
            <div key={ mail.id } className="mail">
              <Card>
                <Card.Body>

                <h4> { mail.id }</h4>
            <h3> { mail.businessRecipient }</h3>
                </Card.Body>

            </Card>
            </div>
          )

        })}
      </div>
    </div>
  );
}

export default App;
